import * as React from 'react';
import Button from '@mui/material/Button';
import {styled} from '@mui/material/styles';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import Typography from '@mui/material/Typography';
import PhoneIcon from '@mui/icons-material/Phone';

const BootstrapDialog = styled(Dialog)(({theme}) => ({
    '& .MuiDialogContent-root': {
        padding: theme.spacing(2),
        'font-family': '"Roboto","Helvetica","Arial",sans-serif !important',
    },
    '& .MuiDialogActions-root': {
        padding: theme.spacing(1),
    },
}));

const styles = {
    dialogTitle: {
        m: 0,
        p: 2,
        'font-family': '"Roboto","Helvetica","Arial",sans-serif !important',
        'font-size': '1.75rem',
        'text-align': 'center'
    },
    dialogButton: {
        color: '#000000 !important',
        'border-color': '#FF0000 !important',
        'border-radius': '20px !important',
        width: '120px',
        marginTop: '20px !important'
    }
};

interface OrderDialogProps {
    openProp?: boolean
}

export default function OrderDialog({openProp}: OrderDialogProps) {
    const [open, setOpen] = React.useState(openProp ?? false);

    const handleClickOpen = () => {
        setOpen(true);
    };
    const handleClose = () => {
        setOpen(false);
    };

    return (
        <React.Fragment>

            <Button sx={styles.dialogButton} variant="outlined" onClick={handleClickOpen} startIcon={<PhoneIcon />}>
                Order
            </Button>
            <BootstrapDialog
                onClose={handleClose}
                aria-labelledby="customized-dialog-title"
                open={open}
            >
                <DialogTitle sx={styles.dialogTitle} id="customized-dialog-title">
                    Order Book
                </DialogTitle>
                <IconButton
                    aria-label="close"
                    onClick={handleClose}
                    sx={(theme) => ({
                        position: 'absolute',
                        right: 8,
                        top: 20,
                        'font-family': 'OpenSans-Bold',
                        'font-size': '1.75rem',
                        color: theme.palette.grey[800],
                    })}
                >
                    <CloseIcon/>
                </IconButton>
                <DialogContent sx={{'text-align': 'center'}}>
                    <Typography gutterBottom>
                        We currently only accept phone-in orders
                    </Typography>
                    <br/>
                    <br/>
                    <Typography gutterBottom>
                        Please call: <b>02-587-9632</b>
                    </Typography>
                    <Typography gutterBottom>
                        Business hours: <b>8AM - 6PM</b>
                    </Typography>
                </DialogContent>
            </BootstrapDialog>
        </React.Fragment>
    );
}
